import React from 'react';


function ToDoItem(props) {

    return ( 
        <div onClick={ () => {
            props.onChecked(props.id)
        } }>
            <div>
                <li>{props.text}</li>
                <button>
                    <span>Edit</span>
                </button>
            </div>
        </div>
    )
}

export default ToDoItem;
